import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      string: "hello ansela"
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>{this.state.string}</p>
          <button onClick={() => this.setState({ string: "hello world!" })}>
            Change text
          </button>
        </header>
      </div>
    );
  }
}
export default App;
